import React, { useEffect, useState } from "react";
import axios from "axios";
import "../Cards.css";

export default function Chats(props) {
  const [chatGroup, setChatGroup] = useState({});
  const token = sessionStorage.getItem("token");

  useEffect(() => {
    const chatGroupId = props.match.params.chatGroupId;
    const getChatGroupData = async (chatGroupId) => {
      try {
        const response = await axios.get(`http://localhost:3001/app/get-chat-group/${chatGroupId}`, {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        });
        setChatGroup(response.data);
      } catch (error) {
        console.log(error);
      }
    };
    getChatGroupData(chatGroupId);
  }, [props.match.params.chatGroupId, token]);

  return (
    <div className="cards__container">
      <h2>{chatGroup.chatGroupId}</h2>
      {/* Diğer chat grubu bilgilerini burada görüntüleme */}
    </div>
  );
}
